import BillTotal from '../BillTotal/BillTotal';
import BillOptions from '../BillOptions/BillOptions';

const App = () => {
  return (
    <div className='bills-container'>
    <BillProvider>

    <AddBill/>
    <BillOptions/>
    <BillList/>
    <BillTotal/>

    </BillProvider>


    </div>
  );
}

export default App;
